    responseConverter: geoJsonConverter,
    responseHandler: 'basic',
    implementsRenderComplete: true,
    visualization: CoordinateMapsVisualization,
    editorConfig: {
      collections: {
        legendPositions: [{
          value: 'bottomleft',
          text: 'bottom left'
        }, {
          value: 'bottomright',
          text: 'bottom right'
